sys_variable_value.value:
(function execute(inputs, outputs) {
  try {
    outputs.payload =  JSON.stringify(new JustificationAndApproval(inputs.acquisition_package).getPayload());
  } catch (error) {
    outputs.error_code = error.code;
    outputs.error_message = error.message;
  }

})(inputs, outputs);

